import CustomButton from "./CustomButton";

function List(props) {
  return (
    <div className="square-style">
      {props.list.title}
      {props.list.desc}
      <CustomButton
        color="red"
        onClick={() => {
          props.handleDelete(props.list.id);
        }}
      >
        삭제하기
      </CustomButton>
      <CustomButton
        color="green"
        onClick={() => {
          props.handleDone(props.list.id);
          props.setDoneTitle(props.list.title);
          props.setDoneDesc(props.list.desc);
        }}
      >
        완료
      </CustomButton>
    </div>
  );
}

export default List;
